window.bookSummaryJSON = "<p>An agent, an heiress and a deadly rescue mission… </p> <p>Media heiress Josie Jessup and her son have spent the past several years in witness protection, yet they are anything but safe. When her father is attacked, Josie decides it's time to return home…and walks right into a deadly trap. </p> <p>Despite their tumultuous history, FBI agent Brendan O'Hannigan - Josie's former lover and the last man she wants to see - comes to her rescue. As the main reason Josie had to go into hiding in the first place, Brendan knows he has a lot to prove in order to earn her trust. But to reveal his real motive for taking on this case will destroy everything he's worked for. Josie has no idea just how important this mission is…or just how far Brendan will go to ensure their reunion remains permanent.</p>"; 
